import React from "react";
import { Fade } from "react-reveal";
import "../../styles/Footer.scss";
import linkedin from "../../static/media/green-linkedin.svg";
import github from "../../static/media/github.svg";

const Footer = () => {
  return (
    <Fade right cascade>
      <div className="footer">
        <div
          key="linkedin"
          className="social-link"
          onClick={() => {
            window.location.href ="https://www.linkedin.com/in/matthew-ly-447b77164/";
          }}
        >
          <img src={linkedin} alt=""/>
        </div>

        <div
          key="github"
          className="social-link"
          onClick={() => {
            window.location.href ="https://github.com/Matt-Ly";
          }}
        >
          <img src={github} alt=""/>
        </div>
      </div>
    </Fade>
  );
};

export default Footer;
